import React from 'react';
import { Text, View } from 'react-native';

const NewPass = () => {
  return (
    <View style={{
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center'
      }}>
      <Text>Hello, world!</Text>
    </View>
  );
}

export default NewPass;
